INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(279384, 'zhCN', '幽坑太保的爆破竞赛', '幽坑太保的爆破竞赛', 59888),
(279845, 'zhCN', '不……', '', 59888),
(275804, 'zhCN', '你知道这东西花了我多少钱吗？我要把你的小绿皮剥下来，加兹鲁维！', '', 59888),
(268880, 'zhCN', '看着我的船长拨乱反正，还有加里维克斯给他的宝贝，我整个人都兴奋起来啦！', '', 59888),
(271175, 'zhCN', '', '可我玩得很开心……', 59888),
(271159, 'zhCN', '', '我的行政特别版！你！你会和雷吉克一个下场！', 59888),
(268888, 'zhCN', '黑血是加里维克斯老板的！', '', 59888),
(268887, 'zhCN', '我们这就来帮你卸货！', '', 59888),
(275706, 'zhCN', '我管这个叫绿噪音！', '', 59888),
(275703, 'zhCN', '目前最棒的测试品！', '', 59888),
(275100, 'zhCN', '该我了！', '', 59888),
(275029, 'zhCN', '老大不允许，谁也别想过去。', '', 59888),
(274595, 'zhCN', '准备大胜一场吧！', '', 59888),
(275947, 'zhCN', '我是你见到的最后一个老板。', '', 59888),
(275944, 'zhCN', '这是你们欠我的！', '', 59888),
(275943, 'zhCN', '嘿！快过来！', '', 59888),
(282252, 'zhCN', '是飙车，法官大人。公共辩护人飙车。', '', 59888),
(282250, 'zhCN', '是真的，法官大人。如果需要的话，我可以向您介绍这条法规的来龙去脉……', '', 59888),
(282246, 'zhCN', '法官大人，加乐宫实际上是有所有者的。', '', 59888),
(282244, 'zhCN', '很简单，法官大人。所有者死了。必须把它送去我们伟大的拍卖行进行拍卖！', '', 59888),
(281492, 'zhCN', '玛提·飙车也准备好了。完毕，法官大人。', '', 59888),
(281491, 'zhCN', '塔波纳拉·菲兹克兰克已经全心全意地准备好了，尊贵的法官大人。', '', 59888),
(276966, 'zhCN', '他还在法庭四处布置了炸弹，法官大人。不过都被$p拆除了。', '', 59888),
(276963, 'zhCN', '法官大人，真相已经很明显了！凶手只有可能是……$p！', '', 59888),
(276962, 'zhCN', '法官大人，我们刚刚得到证据，谋害罗斯博德·加里维克斯的凶手就在法庭中！', '', 59888),
(280948, 'zhCN', '', '要来点小吃吗？或者来个“托克合影器”？这可是用钱能买到的最棒的拍照道具！而且*这玩意*绝对不会压坏人或者小商铺！\n\n……这在以前可是个大问题……', 59888),
(280946, 'zhCN', '我还在处理没完没了的故障，这场变革让我感觉有些刺激过头了。\n\n要不要试试琢面的修面美容机？它不只能让你恢复如初——还能让你变得更漂亮！', '', 59888),
(280940, 'zhCN', '哟哟哟……想插手我的生意？抱歉，小朋友，没人会满足于只分一小杯羹。等你腰包鼓起来了，也许咱们才能谈生意。', '', 59888),
(280939, 'zhCN', '前台刚问过老板，说你和朋友可以直接进去。当然……你得有足够的经验才行。这么说吧，向我证明你能轻松摆平穆格·兹伊，我就能火速把你送进秘密内室，啥时候都行。\n\n您对加乐宫的忠诚让我们感激不尽。*就算*您把这儿闹个天翻地覆也无所谓！', '', 59888),
(280933, 'zhCN', '老板交代过，不能跟外人说咱们的武器都是假货——得让游客以为是真的才好赚钱嘛。\n\n所以可千万别说漏嘴啊，*特别*是不能告诉陌生人。', '', 59888),
(280080, 'zhCN', '<愤怒的大叫>', '', 59888),
(279822, 'zhCN', '', '下辈子再见吧，傻瓜。', 59888),
(275813, 'zhCN', '有人要大发雷霆了。你想赶我走？再试试吧，我们很快就会再见的。', '', 59888),
(275810, 'zhCN', '而你们就没被允许！是吧，穆格？', '', 59888),
(275777, 'zhCN', '有啦！加里维克斯看到了非得跳起来不可！除非他看不见。唔，我们应该先进行市场测试。', '', 59888),
(275539, 'zhCN', '', '真扫兴，就在最精彩的地方断了！', 59888),
