(2640, 'zhCN', '血腥大熔炉', '历史的长河见证了许多史诗之战，但在最为劲爆的这场大战中，交战的双方分别是电光四射的风暴巨猩托克，以及一头熔火机甲暴龙，狂龙弗莱兰多。今夜，所有人只为见证两位冠军在大熔炉内战个天翻地覆，把整个安德麦都撕成两半！快来见证这场腥风血雨，否则你就是地精之耻！', 59888);
