(30331, 'zhCN', '综述', '弗莱兰多和托克为观众奉献一场精彩的演出，扔出|cFF2959D3|Hspell:473650|h[废物炸弹]|h|r，并使场内的战斗人员受到|cFF2959D3|Hspell:473951|h[静电充能]|h|r影响。\n在达到100点能量时，弗莱兰多和托克会一同卷入|cFF2959D3|Hspell:465833|h[巨械争斗]|h|r！', 59888),
(27555, 'zhCN', '治疗者', '$bullet;在持续时间结束时，|cFF2959D3|Hspell:424739|h[混沌腐蚀]|h|r会爆发并跳跃到最近的玩家身上。\n$bullet;|cFF2959D3|Hspell:424739|h[混沌腐蚀]|h|r对当前目标造成中等的周期性伤害。\n$bullet;|cFF2959D3|Hspell:425052|h[黑暗引力]|h|r在持续期间对所有玩家造成中等伤害。', 59888),
(30489, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:465952|h[超大捆劣性炸药]|h|r和|cFF2959D3|Hspell:1214607|h[超大更猛炸弹轰击]|h|r能额外触发|cFF2959D3|Hspell:466158|h[工兵的背包]|h|r和|cFF2959D3|Hspell:1214755|h[过载火箭]|h|r。\n$bullet;濒死的暗索技师会释放极巨大炸弹，其会在$1223905D后造成|cFF2959D3|Hspell:1223905|h[极巨大爆破！]|h|r。加里维克斯的|cFF2959D3|Hspell:469327|h[极巨大冲击]|h|r会立刻引爆炸弹。\n$bullet;|cFF2959D3|Hspell:469362|h[充能的极巨大炸弹]|h|r一旦接触极巨大控制器就会引发一场|cFF2959D3|Hspell:469767|h[极巨大炸弹爆炸]|h|r，造成|cFF2959D3|Hspell:1220846|h[控制熔毁]|h|r，能够打断加里维克斯的|cFF2959D3|Hspell:469286|h[极巨大线圈]|h|r。\n$[15,16$bullet;神射哨卫如果处于不受控制的状态，则会使用|cFF2959D3|Hspell:466834|h[震击弹幕]|h|r造成高额伤害。$]', 59888),
(30488, 'zhCN', '治疗者', '$bullet;受到|cFF2959D3|Hspell:1220761|h[机械工程师的弹药筒]|h|r影响的玩家会在吞噬或持续时间结束时被引爆，引发一阵|cFF2959D3|Hspell:474447|h[弹药筒爆破]|h|r。\n$bullet;濒死的暗索技师会释放极巨大炸弹，其会在$1223905D后造成|cFF2959D3|Hspell:1223905|h[极巨大爆破！]|h|r。加里维克斯的|cFF2959D3|Hspell:469327|h[极巨大冲击]|h|r会立刻引爆炸弹。\n$bullet;|cFF2959D3|Hspell:469362|h[充能的极巨大炸弹]|h|r一旦接触极巨大控制器就会引发一场|cFF2959D3|Hspell:469767|h[极巨大炸弹爆炸]|h|r，造成|cFF2959D3|Hspell:1220846|h[控制熔毁]|h|r，能够打断加里维克斯的|cFF2959D3|Hspell:469286|h[极巨大线圈]|h|r。\n$bullet;|cFF2959D3|Hspell:469286|h[极巨大线圈]|h|r、|cFF2959D3|Hspell:466338|h[急转飞射火箭]|h|r、和|cFF2959D3|Hspell:1214369|h[毁灭一切！！！]|h|r能造成大量伤害。', 59888),
(30487, 'zhCN', '坦克', '$[15,16$bullet;|cFF2959D3|Hspell:465952|h[超大捆劣性炸药]|h|r和|cFF2959D3|Hspell:1214607|h[超大更猛炸弹轰击]|h|r额外生成|cFF2959D3|Hspell:466165|h[1500磅的“哑弹”]|h|r。$]\n$bullet;|cFF2959D3|Hspell:466340|h[裂破弹药筒]|h|r和|cFF2959D3|Hspell:1214607|h[超大更猛炸弹轰击]|h|r会波及加里维克斯前方的玩家。\n$bullet;濒死的暗索技师会释放极巨大炸弹，其会在$1223905D后造成|cFF2959D3|Hspell:1223905|h[极巨大爆破！]|h|r。加里维克斯的|cFF2959D3|Hspell:469327|h[极巨大冲击]|h|r会立刻引爆炸弹。\n$bullet;一旦加里维克斯达到了$1220290s2层堆叠效果，或者改变主要目标，他就会释放所有的|cFF2959D3|Hspell:1220290|h[技巧射击]|h|r。', 59888),
