(31956, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:468846|h[跃动火花]|h|r会追击玩家，并在触及目标时使其昏迷。\n$bullet;|cFF2959D3|Hspell:465279|h[水坝渗流]|h|r接触到吉泽尔的电流技能后会通电。\n$bullet;|cFF2959D3|Hspell:465463|h[涡轮增压]|h|r和|cFF2959D3|Hspell:468813|h[超力震击]|h|r会造成大量伤害。', 59888),
(31102, 'zhCN', '坦克', '$bullet;里克的|cFF2959D3|Hspell:466128|h[共振]|h|r会使附近的增幅器获得额外能量。\n$bullet;|cFF2959D3|Hspell:464488|h[音波冲击]|h|r会对前方锥形范围造成声波伤害并施加|cFF2959D3|Hspell:464518|h[耳鸣]|h|r。音波冲击无法被护甲格挡或降低。\n$bullet;里克会施放致命的|cFF2959D3|Hspell:466722|h[高音骤降]|h|r，使增幅器|cFF2959D3|Hspell:467991|h[失灵]|h|r并击飞玩家。', 59888),
(30506, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:466518|h[熔火真金指虎]|h|r会对穆格的前方造成大量伤害，并对被击中的玩家施加|cFF2959D3|Hspell:467202|h[纯金滴露]|h|r。\n$bullet;|cFF2959D3|Hspell:469490|h[双厄射击]|h|r的伤害可以被击中的最近的一名玩家降低。', 59888),
(30486, 'zhCN', '综述', '加里维克斯持续获得能量，并在达到最大能量时激活铬武场的|cFF2959D3|Hspell:469286|h[极巨大线圈]|h|r。将|cFF2959D3|Hspell:469362|h[充能的极巨大炸弹]|h|r带到极巨大控制器处会触发一次|cFF2959D3|Hspell:469767|h[极巨大炸弹爆炸]|h|r。这会导致|cFF2959D3|Hspell:1220846|h[控制熔毁]|h|r并打断加里维克斯的|cFF2959D3|Hspell:469286|h[极巨大线圈]|h|r。两个极巨大线圈都失效之后会形成一片|cFF2959D3|Hspell:1215209|h[破坏区域]|h|r。\n\n此外，加里维克斯会在战斗中召唤重金聘请的暗索打手来协助他。\n\n随着战斗的继续，加里维克斯还会更换和强化他的军械，带来更疯狂的混乱。$[14,15,17$  当生命值降低至50%时，加里维克斯会升级能力，想要彻底铲除玩家。$]', 59888),
(30082, 'zhCN', '治疗者', '$bullet;如果在|cFF2959D3|Hspell:461060|h[转向胜利！]|h|r期间没有存入两个礼券，或者侦测到重复的组合，则独臂盗匪会使用|cFF2959D3|Hspell:461068|h[有人耍诈！]|h|r。\n$bullet;|cFF2959D3|Hspell:460164|h[污秽排放]|h|r会降低所有玩家的移动速度，并吸收大量治疗。\n$bullet;站在|cFF2959D3|Hspell:460181|h[奖励路线]|h|r凭证附近会成为|cFF2959D3|Hspell:460444|h[豪客！]|h|r。', 59888),
