(31132, 'zhCN', '伤害输出者', '$bullet;库尔萨洛克会尝试使用|cFF2959D3|Hspell:473959|h[抽取灵魂]|h|r将玩家的灵魂剥离。如果灵魂抵达库尔萨洛克身边，他会为其注入通灵能量，造成|cFF2959D3|Hspell:474013|h[灵魂腐蚀]|h|r。\n$bullet; |cFF2959D3|Hspell:1216474|h[死亡螺旋]|h|h|r会产生旋转的通灵能量法球，对触及的玩家造成暗影伤害。', 59888),
