INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'zhCN', '茶毛米克西', '|cFFFFD200游戏商城|r|n', '茶毛米克西以沁人心脾的茶香味而闻名，但其调皮的天性也令不少茶水洒了出来。', 59888),
(2344, 'zhCN', '滚爪米克西', '|cFFFFD200游戏商城|r|n', '驮茶送水的职责令滚爪米克西无比自豪。它们很乐意和自己的旅伴分享温热的茶饮。', 59888),
(2343, 'zhCN', '柔爪米克西', '|cFFFFD200游戏商城|r|n', '柔爪米克西泡得一手好红茶，既能清晨提神，也适合挑灯夜战。', 59888),
(2342, 'zhCN', '绒毛米克西', '|cFFFFD200游戏商城|r|n', '绒毛米克西生性淘气、举止笨拙却又爱好干净。这几种特性融合起来可就太危险了。', 59888),
(2489, 'zhCN', '珠光彩蝶', '|cFFFFD200商栈|r', '让闪闪发亮、熠熠生辉、珠光宝气的蝴蝶带你飞上天吧。', 59888),
(2288, 'zhCN', '私人订制地精S.C.R.A.P拆废机', '|cFFFFD200掉落：|r筛过的废料堆|n|cFFFFD200地区：|r安德麦', '地精伐木机一次又一次地证明了自己的无所不能，在伐木和运输方面都十分优秀。这个型号根据S.C.R.A.P.的使用需求进行了改装。', 59888),
(2346, 'zhCN', '酿盗米克西', '|cFFFFD200游戏商城|r|n', '尽管这些生物性情多变且喜欢玩闹，但它们是忠诚可靠的旅行伙伴。', 59888),
(2296, 'zhCN', '地下堡行者的地精疾行器', '|cFFFFD200世界任务：|r我要找回帽子|n|cFFFFD200地区：|r多恩岛|n|cFFFFD200地区：|r多恩诺嘉尔', '这架飞行器能帮助你一头扎进冒险，只要它不爆炸就行！', 59888),
(2279, 'zhCN', '雷鼓哑炮火箭', '|cFFFFD200商人出售：|r老枪安多|n|cFFFFD200地区：|r解放安德麦|n|cFFFFD200价格：|r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', '在一场尤其惨烈的争斗期间，从血腥大熔炉的露天看台上回收而来。被问及是否打出哑弹时，托克的操作手轻描淡写地回答道：“大概吧？”', 59888),
(2276, 'zhCN', '暗索嚼压者', '|cFFFFD200商人出售：|r老枪安多|n|cFFFFD200地区：|r解放安德麦|n|cFFFFD200价格：|r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', '斯提克斯的垃圾场土狼中的领头犬，其强劲的咬合力足以将一切事物压得粉碎——对付加里维克斯想要搞定的人自然不在话下。', 59888),
(1471, 'zhCN', '仇怨', '|cFFFFD200掉落：|r希尔瓦娜斯·风行者|n|cFFFFD200地区：|r统御圣所|n|cFFFFD200难度：|r史诗', '阿尔萨斯夺去希尔瓦娜斯生命的那天，希尔瓦娜斯失去了她自我的一部分。她内心的阴影开始壮大，填补了那份空虚。', 59888);
