(12933, 'zhCN', '穆格·兹伊主管着加乐宫内部的安保体系，使加里维克斯的娱乐城固若金汤。有这个强大的食人魔在，谁也别想动铬武大王一根毛。', '双头能敌四手', 59888),
(12902, 'zhCN', '链齿狂人洛肯斯多是工程设计的大师，他的装配线正持续不断地产出破坏力十足的军火。如果不能赶紧阻止他，整个安德麦都会变成一个浓烟滚滚的大坑。', '疯狂机械师', 59888);
